import Link from 'next/link';

export default function Index(props){
    return(
        <nav>
            <ul>
                <li>
                    <Link h>Home</Link>
                    <Link>Noticias</Link>
                    <Link>Artistas</Link>
                    <Link>Podcasts</Link>
                </li>
            </ul>
        </nav>
    );
}
